import React from 'react';
import { useDispatch } from "react-redux";
import { useHistory } from 'react-router-dom';
import  {addName, addEmail, addPassword} from '../actions/usersAction'


function Account() {

    const history = useHistory();
    const [name, setName] =  useState('');
    const [email, setEmail] =  useState('');
    const [password, setPassword] =  useState('');

    const dispatch = useDispatch();
    console.log(name, email, password);

    dispatch(addName(name))
    dispatch(addEmail(email))
    dispatch(addPassword(password))


    return (
        <div>
                <h1>Ditt konto</h1>

            <label >NAME </label><br />
            <input type="text" onChange={ (e) => setName(e.target.value)}placeholder="Full Name"/><br />

            <label >EMAIL</label><br />
            <input type="text" onChange={ (e) => setEmail(e.target.value)} placeholder="Email"/><br />

            <label >PASSWORD</label><br />
            <input type="password" onChange={ (e) => setPassword(e.target.value)} placeholder="Password"/><br />

            <button onClick = {() => history.push('/')}>Spara</button>


        </div>




    )
}

export default Account;
